using namespace std;
long long MOD = 1000000007;
     long long C(int a, int b) {
        if(b == 2) return a >=2 ? (a * (a-1) % MOD) /2: 0;
        else if(b == 3)  {
            long long x= (long long)a * (long long)(a-1) * (long long)(a-2) / 6;
            if(a >=3)return x;
            else return 0;
        }
    }

    int threeSumMulti(vector<int>& A, int target) {
        vector<int> h(200);
        int size = A.size();
         long long res = 0;
        for(int i = 0; i < size; ++i) {
            h[A[i]]++;
        }
        long long t;
        for(int i = 0; i <= 100; ++i) {
            for(int j = i; j <= 100; ++j) {
                int k = target - i - j;
                if(k <= 100 && k >= 0 && k >= j) {
                    if(i == j && j == k) {
                        t = C(h[i], 3);
                        cout << t << endl;
                        t = t % MOD;
                        cout << t << endl;
                        cout <<h[0] << endl;
                        res = (res + t) % MOD;
                    } else if(i == j && j != k){
                        t = C(h[i], 2) * h[k] % MOD;
                        res = (res + t) % MOD;
                    } else if(i != j && j == k){
                        t = C(h[j], 2) * h[i] % MOD;
                        res = (res + t) % MOD;
                    } else if(i != j && j!=k && i != k){
                        t = h[i] * h[j] % MOD * h[k] % MOD;
                        res = (res + t) % MOD;
                    }
                }
            }
        }
        return res;
    }

